import { createApp } from 'vue'
import { createWebHashHistory, createRouter } from 'vue-router';
import { default as App } from '@/App.vue'
import { routes } from '@/assets/script/index.js'
import { get_my_ip } from './assets/script/get_my_ip';

const router = createRouter({
    history: createWebHashHistory(),
    routes : routes
})

const vue = createApp(App);

vue.use(router);
vue.mount('#app');

//모든 파일에서 사용할 전역변수 작성
//my_ip == 현재 내가 사용하는 public ip
vue.config.globalProperties.$my_ip;
// my_ip에 값을 넣기 위해 함수 실행
get_my_ip();
